import React from "react";
import Avatar from "@material-ui/core/Avatar";
import Button from "@material-ui/core/Button";
import { makeStyles } from "@material-ui/styles";
import AccountCircleIcon from '@material-ui/icons/AccountCircle';
import { useHistory, Link } from "react-router-dom";

import fire from "../fire";

const useStyles = makeStyles((theme) => ({
  avatar: {
    '&:hover':{
      backgroundColor: "grey",
      cursor: "pointer",
    },
  },
  avatar2: {
    color:"white",
    width: "40px",
    height: "40px",
    '&:hover':{
       color:"grey"
    }
 }
}))

function Profile(props) {
  const classes = useStyles();
  const history = useHistory();

  const onClick = () => {
    history.push("/profile");
  }
  
  return(
    <div style={{marginTop:"10px", marginBottom:"10px", marginLeft:"auto", marginRight:"10px"}}>
      {fire.auth().currentUser ?
        <Avatar className={classes.avatar} src={fire.auth().currentUser ? null : null}>
            <Button component={Link} to="/about/history">
              {fire.auth().currentUser.displayName.match(/(\b\S)?/g).join("").toUpperCase()}
            </Button>
        </Avatar>:
        <AccountCircleIcon onClick={() => {history.push("/profile")}} className={classes.avatar2}/>
      }
    </div>
  );
}

export default Profile;
